enum EitherBody<L, R = BoxBody> {
    Left {
            body: L,
        },
    Right {
            body: R,
        },
}

fn h1<F, B>(Self, F) -> H1Service<T, S, B, X, U> where B: MessageBody,
F: IntoServiceFactory<S, Request>, S::Error: Into<Response<BoxBody>>,
S::InitError: fmt::Debug, S::Response: Into<Response<B>>

enum Payload<S = BoxedPayloadStream> {
    None,
    H1 {
            payload: crate::h1::Payload,
        },
    H2 {
            payload: crate::h2::Payload,
        },
    Stream {
            payload: S,
        },
}

enum Item {
    FirstText(Bytes),
    FirstBinary(Bytes),
    Continue(Bytes),
    Last(Bytes),
}

enum DispatcherError<E, U, I> where U: Encoder<I> + Decoder {
    Service(E),
    Encoder(<U as Encoder<I>>::Error),
    Decoder(<U as Decoder>::Error),
}
